import React from "react";
import { Col, Row } from 'reactstrap';

const Header = () => {
    return (
        <div>
            <Row>
            <Col md='2'>
                <h1>Hello!</h1>
            </Col>
            </Row>
        </div>
    )
}

export default Header;
